import './navbar.scss';

function NavBar() {
  return (
    <div className="Bar">
      <ul id="nav">
        <li><a href="/About">About</a></li>
        <li><a href="/Projects">Projects</a></li>
      </ul>
    </div>
  )
}

export default NavBar
